import React from "react";
// reactstrap components
import {
    Button,
    Card,
    CardImg,
    CardHeader,
    CardBody,
    Input,
    FormGroup ,
    Row,
    Col
} from "reactstrap";

class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            bigChartData: "data1"
        };
    }
    render() {
        return (
            <>
            <Row>
                <Col md='5' p-0 >
             <Card heigth="100%">
             <CardImg  src={require("assets/img/theme/auth.png")}>
            </CardImg>
             </Card>
             </Col>
             <Col md='7' p-0>
             <div className="content">
             <Col className="pr-md-1" md="6">
                    <FormGroup>

                      <Input
                        placeholder="Enter your email address"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  </div>
             </Col>
            </Row>
            </>
        );
    }
}
export default Login;
